    }

    return(
        <div className={`${styles.wrap}`}>
            <form className={`${styles.form}`}>
                <input id="search" className={`${styles.search}`} placeholder="Search..." autofocus required 
                onChange={(event) => productFilter(event)}/>    
            </form>
        </div>
    );
}

